import React from 'react';

function CartItems({ items }) {
  return (
    <div className="card">
      <div className="card-body">
        <h5 className="card-title">Cart Items</h5>
        <ul className="list-group">
          {items.map(item => (
            <li key={item.id} className="list-group-item">
              <div>Title <span className='m-2'>#{item.product.title}</span></div>
              <div>Total <span className='m-2'>#{item.total_amount}</span></div>
            <div>
              <div className="mb-3">
              <label htmlFor="item-qty" className="form-label">item-tqy</label>
              <input
                type="number"
                className="form-control"
                id="item-qty"
                value={item.units}
                required
              />
              </div>
            </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default CartItems;
